E_D("replace into `phome_ecms_game` values('10885','31','0','','','','1','admin','|16|','1','0','1343264942','0','0','0','0','','','10885','0','0','0','0','0','0','三只小猪学英语 22','1343264942','/spic/20120726/7115.jpg','0','1','1343264942','0','3','1','0','','0','','/d/file/swf/4661.swf','667','479','-Hello.Benben and Jesse.<br /><br />-Hi，Yiya.<br /><br />-What is it?<br /><br />-It’s an animal picture book.<br /><br />-Look，a snake.<br /><br />-Do you like snakes?<br /><br />-No，I don’t. What’s that?<br /><br />-It’s a rabbit. Do you like rabbits?<br /><br />-Yes.I do.<br /><br />-What’s this in your hand?<br /><br />-It’s a sports book.<br /><br />-Do you like sports?<br /><br />-Yes， I do.<br /><br />-Do you like basketball?<br /><br />-Oh，no! I don’t like basketball.Jesse likes it.<br /><br />-Do you like ping-pong?<br /><br />-Yes，I do.<br /><br />-Jesse， do you like ping-pong?<br /><br />-Oh，no. I don’t like it.<br /><br />-What’s your favorite sport?<br /><br />-It’s cycling.<br /><br />-Me too!<br /><br />-I also like cycling very much.Let’s go cycling.<br /><br />-Yes! That’s great.<br /><br />-Where are the bikes?<br /><br />-I don’t know.','1','','0','','1','/dpic/20120726/7116.jpg','4661','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRXlUbXBGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4661.swf','http://www.61baobao.com/common/flash/d/dpic/4661.jpg','http://www.61baobao.com/common/flash/d/pic/4661.jpg','0','三个月以上','0','','0','','0','0','0');");
